"use strict";(self.webpackChunksite=self.webpackChunksite||[]).push([[541],{541:t=>{t.exports=JSON.parse('{"navigation":{"features":{"content":"\u0935\u093f\u0936\u0947\u0937\u0924\u093e\u090f\u0902"},"blog":{"content":"\u092c\u094d\u0932\u0949\u0917"},"docs":{"content":"\u0921\u0949\u0915\u094d\u0938"},"github":{"content":"GitHub"}},"install":{"chrome":"\u0938\u094d\u0925\u093e\u092a\u093f\u0924 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0915\u094d\u0930\u094b\u092e","firefox":"\u0938\u094d\u0925\u093e\u092a\u093f\u0924 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092b\u093c\u093e\u092f\u0930\u092b\u093c\u0949\u0915\u094d\u0938"},"sections":{"hero":{"title":"\u092d\u093e\u0937\u093e\u0935\u093f\u0926\u094d \u090f\u0915 \u0917\u094b\u092a\u0928\u0940\u092f\u0924\u093e \u0915\u0947\u0902\u0926\u094d\u0930\u093f\u0924, \u092a\u0942\u0930\u094d\u0923 \u0935\u093f\u0936\u0947\u0937\u0924\u093e\u0913\u0902 \u0905\u0928\u0941\u0935\u093e\u0926 \u0938\u092e\u093e\u0927\u093e\u0928 \u0939\u0948 \u0964 ","description":"\u0935\u0947\u092c \u092a\u0943\u0937\u094d\u0920\u094b\u0902 \u0915\u093e \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u0930\u0947\u0902, \u092a\u093e\u0920 \u0939\u093e\u0907\u0932\u093e\u0907\u091f Netflix \u0909\u092a\u0936\u0940\u0930\u094d\u0937\u0915, \u0914\u0930 \u0928\u093f\u091c\u0940 \u0938\u0902\u0926\u0947\u0936. \u0905\u0928\u0942\u0926\u093f\u0924 \u092a\u093e\u0920 \u092c\u093e\u0924 \u0914\u0930 \u092c\u091a\u093e\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092e\u0939\u0924\u094d\u0935\u092a\u0942\u0930\u094d\u0923 \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0905\u092a\u0928\u0947 \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u0917\u0924 \u0936\u092c\u094d\u0926\u0915\u094b\u0936 \u092e\u0947\u0902 \u0936\u092c\u094d\u0926\u094b\u0902 \u0915\u094b \u091c\u093e\u0928\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092f\u0939\u093e\u0902 \u0924\u0915 \u0915\u093f \u0911\u092b\u093c\u0932\u093e\u0907\u0928 \u0964 "},"opensource":{"title":"\u0916\u0941\u0932\u093e \u0938\u094d\u0930\u094b\u0924","content":"\u092d\u093e\u0937\u093e\u0935\u093f\u0926\u094d \u092a\u0942\u0930\u0940 \u0924\u0930\u0939 \u0938\u0947 \u092e\u0941\u0915\u094d\u0924 \u0939\u0948, <0>\u0916\u0941\u0932\u093e \u0938\u094d\u0930\u094b\u0924</0>, \u0914\u0930 \u092f\u0939 \u090f\u0915\u0924\u094d\u0930 \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u093e \u0939\u0948 \u0915\u093f\u0938\u0940 \u092d\u0940 \u0909\u092a\u092f\u094b\u0917\u0915\u0930\u094d\u0924\u093e \u0921\u0947\u091f\u093e \u092c\u0947\u091a\u0924\u0947 \u0939\u0948\u0902.<br><br>\u0906\u092a \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 <1>\u0907\u0938 \u092a\u0930\u093f\u092f\u094b\u091c\u0928\u093e \u0915\u093e \u0938\u092e\u0930\u094d\u0925\u0928</1> \u0905\u092a\u0928\u0947 \u0926\u093e\u0928 \u0915\u0947 \u0938\u093e\u0925 \u092e\u0926\u0926 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092d\u093e\u0937\u093e\u0935\u093f\u0926\u094d \u0905\u092a\u0928\u0940 \u0938\u094d\u0935\u0924\u0902\u0924\u094d\u0930\u0924\u093e \u0915\u094b \u092c\u0928\u093e\u090f \u0930\u0916\u0928\u0947 \u0914\u0930 \u0909\u091a\u094d\u091a \u0917\u0941\u0923\u0935\u0924\u094d\u0924\u093e. \u0936\u0947\u092f\u0930 \u092d\u093e\u0937\u093e\u0935\u093f\u0926\u094d \u0915\u0947 \u0938\u093e\u0925 \u0905\u092a\u0928\u0947 \u0926\u094b\u0938\u094d\u0924\u094b\u0902 \u0915\u0947 \u0932\u093f\u090f \u0907\u0938\u0947 \u0932\u094b\u0915\u092a\u094d\u0930\u093f\u092f \u092c\u0928\u093e\u0928\u0947 \u0915\u0947 \u0938\u093e\u0925!"},"support":{"title":"\u0938\u092e\u0930\u094d\u0925\u0928","content":"\u0915\u0947 \u0932\u093f\u090f \u0938\u092e\u0930\u094d\u0925\u0928 \u0938\u0947 \u0938\u0902\u092a\u0930\u094d\u0915 \u0915\u0930\u0947\u0902 <0/>. \u092f\u0926\u093f \u0906\u092a \u092c\u0917 <1>\u092c\u0928\u093e\u0928\u0947 \u0915\u0947 \u092e\u0941\u0926\u094d\u0926\u0947</1> GitHub \u092a\u0930."},"createdBy":{"content":"\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092c\u0928\u093e\u0908 \u0917\u0908 <0/>."}},"features":{"title":"\u0935\u093f\u0936\u0947\u0937\u0924\u093e\u090f\u0902","items":{"offlineTranslation":{"title":"\u0911\u092b\u093c\u0932\u093e\u0907\u0928 \u0905\u0928\u0941\u0935\u093e\u0926 \u0914\u0930 \u0917\u094b\u092a\u0928\u0940\u092f\u0924\u093e","content":"\u092d\u093e\u0937\u093e\u0935\u093f\u0926\u094d \u0917\u094d\u0930\u0902\u0925\u094b\u0902 \u0915\u093e \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u092f\u0939\u093e\u0902 \u0924\u0915 \u0915\u093f \u0907\u0902\u091f\u0930\u0928\u0947\u091f \u0915\u0947 \u092c\u093f\u0928\u093e - \u090f\u0915 \u0935\u093f\u0936\u0947\u0937\u0924\u093e \u0939\u0948 \u0915\u093f \u0915\u094b\u0908 \u0905\u0928\u094d\u092f \u090f\u0915\u094d\u0938\u091f\u0947\u0902\u0936\u0928 \u0939\u0948. \u0911\u092b\u093c\u0932\u093e\u0907\u0928 \u0905\u0928\u0941\u0935\u093e\u0926\u0915 \u0915\u0940 \u0905\u0928\u0941\u092e\u0924\u093f \u0926\u0947\u0924\u093e \u0939\u0948 \u0906\u092a \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0917\u094d\u0930\u0902\u0925\u094b\u0902 \u0915\u093e \u0905\u0928\u0941\u0935\u093e\u0926 \u0906\u092a\u0915\u0947 \u0921\u093f\u0935\u093e\u0907\u0938 \u092a\u0930 \u092d\u0947\u091c\u0928\u0947 \u0915\u0947 \u092c\u093f\u0928\u093e \u0915\u093f\u0938\u0940 \u092d\u0940 \u0928\u093f\u091c\u0940 \u0938\u0902\u0926\u0947\u0936 \u0907\u0902\u091f\u0930\u0928\u0947\u091f \u092a\u0930, \u0906\u092a\u0915\u0940 \u0917\u094b\u092a\u0928\u0940\u092f\u0924\u093e \u0915\u094b \u0938\u0941\u0928\u093f\u0936\u094d\u091a\u093f\u0924 \u0915\u0930\u0928\u0947. \u092c\u0938 \u092a\u0930 \u0938\u0941\u0935\u093f\u0927\u093e \u0915\u094b \u0938\u0915\u094d\u0937\u092e \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0935\u093f\u0915\u0932\u094d\u092a \u092a\u0943\u0937\u094d\u0920 \u0906\u092a\u0915\u0940 \u0917\u094b\u092a\u0928\u0940\u092f\u0924\u093e \u092c\u0928\u093e\u090f \u0930\u0916\u0928\u0947 \u0915\u093e \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u0930\u0924\u0947 \u0938\u092e\u092f \u0915\u093e\u092e \u0908\u092e\u0947\u0932 \u0914\u0930 \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u0917\u0924 \u0938\u0902\u0926\u0947\u0936 \u0939\u0948 \u0964 "},"fullPageTranslation":{"title":"\u092a\u0942\u0930\u0947 \u092a\u0943\u0937\u094d\u0920 \u0915\u093e \u0905\u0928\u0941\u0935\u093e\u0926","content":"\u0924\u0947\u091c\u0940 \u0938\u0947 \u0914\u0930 \u0909\u091a\u094d\u091a \u0917\u0941\u0923\u0935\u0924\u094d\u0924\u093e \u0935\u093e\u0932\u0947 \u092a\u0942\u0930\u0947 \u092a\u0943\u0937\u094d\u0920 \u090f\u0915 \u0915\u094d\u0932\u093f\u0915 \u092e\u0947\u0902 \u0905\u0928\u0941\u0935\u093e\u0926, \u0915\u0947 \u0932\u093f\u090f \u092d\u0940 \u0928\u093f\u091c\u0940 \u092a\u0943\u0937\u094d\u0920\u094b\u0902 \u0915\u0940 \u091c\u0930\u0942\u0930\u0924 \u0939\u0948 \u0915\u093f \u0932\u0949\u0917 \u0907\u0928 \u0915\u0930\u0947\u0902 \u0964 \u0932\u091a\u0940\u0932\u093e \u0935\u093f\u0928\u094d\u092f\u093e\u0938 \u0915\u0947 \u0932\u093f\u090f \u0911\u091f\u094b-\u0905\u0928\u0941\u0935\u093e\u0926 \u0921\u094b\u092e\u0947\u0928 \u0928\u093e\u092e \u0915\u0947 \u0906\u0927\u093e\u0930 \u092a\u0930 \u0914\u0930 \u092d\u093e\u0937\u093e\u0913\u0902 \u092e\u0947\u0902. \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0909\u092a\u0932\u092c\u094d\u0927 \u0939\u0948 \u0939\u0949\u091f\u0915\u0940. \u0906\u092a \u092e\u0942\u0932 \u092a\u093e\u0920 \u0915\u094b \u0926\u0947\u0916\u0928\u0947 \u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092a\u0930 \u092e\u0901\u0921\u0930\u093e."},"selectedTextTranslation":{"title":"\u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u0947 \u0932\u093f\u090f \u091a\u092f\u0928\u093f\u0924 \u092a\u093e\u0920","content":"\u0938\u093e\u092e\u0928\u093e \u0905\u092a\u0930\u093f\u091a\u093f\u0924 \u0936\u092c\u094d\u0926\u094b\u0902 \u0915\u094b \u092a\u0922\u093c\u0928\u0947, \u091c\u092c\u0915\u093f \u090f\u0915 \u0911\u0928\u0932\u093e\u0907\u0928 \u0932\u0947\u0916? \u092c\u0938 \u0915\u093e \u091a\u092f\u0928 \u0915\u0930\u0947\u0902 \u092a\u0943\u0937\u094d\u0920 \u092a\u0930 \u092a\u093e\u0920 \u0914\u0930 \u092c\u091f\u0928 \u092a\u0930 \u0915\u094d\u0932\u093f\u0915 \u0915\u0930\u0947\u0902 \u092f\u0939 \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f. \u0906\u092a \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u092c\u094b\u0932\u0924\u0947 \u0939\u0948\u0902, \u0905\u0928\u0941\u0935\u093e\u0926 \u0914\u0930 \u092e\u0942\u0932 \u092a\u093e\u0920 \u0914\u0930 \u092c\u091a\u093e\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0905\u092a\u0928\u0947 \u0936\u092c\u094d\u0926\u0915\u094b\u0936."},"textTranslation":{"title":"\u092a\u093e\u0920 \u0915\u093e \u0905\u0928\u0941\u0935\u093e\u0926 \u0939\u092e\u0947\u0936\u093e \u0939\u093e\u0925 \u092e\u0947\u0902","content":"\u0905\u0917\u0930 \u0906\u092a \u0915\u0940 \u091c\u0930\u0942\u0930\u0924 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0915\u093f\u0938\u0940 \u092d\u0940 \u092a\u093e\u0920 \u0915\u093e \u0905\u0928\u0941\u0935\u093e\u0926, \u092c\u0938 \u0915\u094d\u0932\u093f\u0915 \u0915\u0930\u0947\u0902 \u092d\u093e\u0937\u093e\u0935\u093f\u0926\u094d \u0916\u094b\u0932\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092c\u091f\u0928 \u0915\u0947 \u0938\u093e\u0925 \u092a\u0949\u092a-\u0905\u092a \u0935\u093f\u0902\u0921\u094b. \u0915\u094b\u0908 \u0914\u0930 \u0905\u0927\u093f\u0915 \u091f\u0948\u092c\u094d\u0938 \u0915\u0947 \u0938\u093e\u0925 \u0905\u0928\u0941\u0935\u093e\u0926 \u0938\u0947\u0935\u093e\u0913\u0902, \u092c\u0938 \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0915\u0930\u0947\u0902 \u092d\u093e\u0937\u093e\u0935\u093f\u0926\u094d."},"knowledgeBase":{"title":"\u092c\u0928\u093e\u0928\u0947 \u0915\u0947 \u0905\u092a\u0928\u0947 \u0938\u094d\u0935\u092f\u0902 \u0915\u0947 \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u0917\u0924 \u091c\u094d\u091e\u093e\u0928 \u0915\u0947 \u0906\u0927\u093e\u0930","content":"\u0915\u093f\u0938\u0940 \u092d\u0940 \u0905\u0928\u0941\u0935\u093e\u0926\u093f\u0924 \u092a\u093e\u0920 \u0907\u0924\u093f\u0939\u093e\u0938 \u092e\u0947\u0902 \u0938\u0939\u0947\u091c\u093e \u0917\u092f\u093e \u0939\u0948, \u0914\u0930 \u0906\u092a \u091c\u094b\u0921\u093c \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u0905\u092a\u0928\u0947 \u092a\u0938\u0902\u0926\u0940\u0926\u093e \u092e\u0947\u0902 \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0905\u092a\u0928\u0947 \u0936\u092c\u094d\u0926\u0915\u094b\u0936. \u0906\u092a \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u0915\u0947 \u0932\u093f\u090f \u0916\u094b\u091c \u092e\u0947\u0902 \u0905\u0928\u0941\u0935\u093e\u0926 \u0926\u094b\u0928\u094b\u0902 \u0905\u092a\u0928\u0947 \u0936\u092c\u094d\u0926\u0915\u094b\u0936 \u0914\u0930 \u0907\u0924\u093f\u0939\u093e\u0938, \u0914\u0930 \u092f\u0939\u093e\u0902 \u0924\u0915 \u0915\u093f \u092b\u093f\u0932\u094d\u091f\u0930 \u0926\u094d\u0935\u093e\u0930\u093e \u0905\u092a\u0928\u0947 \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u0940 \u092d\u093e\u0937\u093e \u0939\u0948 \u0964 \u0936\u092c\u094d\u0926\u0915\u094b\u0936 \u0915\u0940 \u0938\u0941\u0935\u093f\u0927\u093e \u0909\u092a\u0932\u092c\u094d\u0927 \u0939\u0948 \u092f\u0939\u093e\u0902 \u0924\u0915 \u0915\u093f \u091c\u092c \u0906\u092a \u0911\u092b\u093c\u0932\u093e\u0907\u0928 \u0939\u0948\u0902, \u091c\u093f\u0938\u0938\u0947 \u092f\u0939 \u090f\u0915 \u0906\u0926\u0930\u094d\u0936 \u0909\u092a\u0915\u0930\u0923 \u092d\u093e\u0937\u093e \u0938\u0940\u0916\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092f\u093e \u092f\u093e\u0924\u094d\u0930\u093f\u092f\u094b\u0902 \u0915\u0940 \u0906\u0935\u0936\u094d\u092f\u0915\u0924\u093e \u0939\u0948, \u091c\u094b \u0928\u093f\u0930\u0902\u0924\u0930 \u0909\u092a\u092f\u094b\u0917 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0905\u092a\u0928\u0947 \u0936\u092c\u094d\u0926 \u0938\u0942\u091a\u093f\u092f\u094b\u0902 \u0964 "},"customTranslators":{"title":"\u0915\u0938\u094d\u091f\u092e \u0905\u0928\u0941\u0935\u093e\u0926\u0915","content":"\u0915\u0947 \u0935\u093f\u092a\u0930\u0940\u0924 \u0905\u0928\u094d\u092f \u092c\u094d\u0930\u093e\u0909\u091c\u093c\u0930 \u090f\u0915\u094d\u0938\u091f\u0947\u0902\u0936\u0928, \u092d\u093e\u0937\u093e\u0935\u093f\u0926\u094d \u0928\u0939\u0940\u0902 \u0939\u0948 \u0938\u093f\u0930\u094d\u092b \u090f\u0915 \u0906\u0935\u0930\u0923 \u092a\u0930 \u0917\u0942\u0917\u0932 \u0905\u0928\u0941\u0935\u093e\u0926\u0915 \u0935\u093f\u091c\u0947\u091f; \u092f\u0939 \u090f\u0915 \u092a\u0942\u0930\u094d\u0923 \u0914\u0930 \u0938\u094d\u0935\u0924\u0902\u0924\u094d\u0930 \u0905\u0928\u0941\u0935\u093e\u0926 \u092a\u094d\u0930\u0923\u093e\u0932\u0940. \u092f\u0926\u093f \u0906\u092a \u0938\u0902\u0924\u0941\u0937\u094d\u091f \u0928\u0939\u0940\u0902 \u0939\u0948\u0902 \u0915\u0947 \u0938\u093e\u0925 \u090f\u092e\u094d\u092c\u0947\u0921\u0947\u0921 \u0905\u0928\u0941\u0935\u093e\u0926\u0915\u094b\u0902 \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u092d\u093e\u0937\u093e\u0935\u093f\u0926\u094d \u0915\u0947 \u0938\u093e\u0925 \u0905\u092a\u0928\u0947 \u092a\u0938\u0902\u0926\u0940\u0926\u093e \u0905\u0928\u0941\u0935\u093e\u0926 \u0938\u0947\u0935\u093e \u0915\u094b \u091c\u094b\u0921\u093c\u0928\u0947 \u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u090f\u0915 \u0915\u0938\u094d\u091f\u092e \u0905\u0928\u0941\u0935\u093e\u0926\u0915. \u0914\u0930 \u0905\u0927\u093f\u0915 \u092a\u0922\u093c\u0947\u0902 \u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 <0>\u0921\u0949\u0915\u094d\u0938</0>."}}}}')}}]);